import React from "react";

export default class AutoCompletText extends React.Component {
  constructor(props) {
    super(props);
    this.data = ["Toto", "Damien", "Shadd", "Jean"];
  }
  render() {
    return (
      <div>
        <input onChange={e => console.log(e.target.value)} type="text" />
        <ul>
          {this.data.map(data => (
            <li>{data}</li>
          ))}
        </ul>
      </div>
    );
  }
}
